  import define from "https://api.observablehq.com/d/072be1604a4bc79c@764.js?v=3";

    if (name === "viewof mat1") return new Inspector(document.querySelector("#observablehq-viewof-mat1-5ca9fdfc"));

    if (name === "style") return new Inspector(document.querySelector("#observablehq-style-5ca9fdfc"));
    return ["entities","features","mat11","mat","entities2","features2","mat22"].includes(name);
  });
